import React from "react";


const Item = props => {
  return (
    <div className="Person">
      <p onClick={props.click}>
        I am {props.name} and I am {props.age}!
      </p>
      <input type="text" onChange={props.changed} value={props.name}></input>
    </div>
  );
};

export default Item;
